import React, { useState, useEffect } from 'react'
import styles from "../styles/Cart.module.css";
import Image from "next/image";
import { useDispatch, useSelector } from "react-redux";
import {
  PayPalScriptProvider,
  PayPalButtons,
  usePayPalScriptReducer,
} from "@paypal/react-paypal-js";
import axios from "axios";
import { useRouter } from "next/router";
import { reset } from "../redux/cartSlice";
import OrderDetail from "../components/OrderDetail";
import { removeProduct } from "../redux/cartSlice";
import easyinvoice from 'easyinvoice';


const Cart = () => {
  const cart = useSelector((state) => state.cart);
  const [open, setOpen] = useState(false);
  const [cash, setCash] = useState(false);
  const amount = cart.total;
  const currency = "USD";
  const style = { layout: "vertical" };
  const dispatch = useDispatch();
  const router = useRouter();

  const createOrder = async (data) => {
    try {

       const res = await axios.post("http://localhost:3000/api/orders", data);

      const dataInvoice = {
    
    "images": {
        // The logo on top of your invoice
        "logo": '',
        // The invoice background
        // "background": "https://public.easyinvoice.cloud/img/watermark-draft.jpg"
    },
    // Your own data
    "sender": {
        "company": "Pizza Mario",
        "address": "1654 R. Don Road #304.",
        "zip": "85022",
        "city": "New York",
        "country": "United States"
    },
    // Your recipient
    "client": {
        "company": `${data.customer}`,
        "address": `${data.address}`,
        // "zip": "4567 CD",
        // "city": "Clientcity",
        // "country": "Clientcountry"
    },
    "information": {
        // Invoice number
        "number": `${res.data._id}`,
        // Invoice data
        "date": `${new Date(Date.now()).toLocaleString("en-US")}`,
        // Invoice due date
        "due-date": `${new Date(Date.now()).toLocaleString("en-US")}`
    },
    // The products you would like to see on your invoice
    // Total values are being calculated automatically



    "products": 
  cart.products.map(product => 
        ({
            "quantity": `${product.quantity}`,
            "description": `${product.title}`,
            "tax-rate": 0,
            "price":`${product.price}`,
        }))
      ,
   
    // The message you would like to display on the bottom of your invoice
    "bottom-notice": "This is auto generated Invoice of your purchase on Pizza Mario",
    // Settings to customize your invoice
    "settings": {
        "currency": "USD",
    },
};

const result = await easyinvoice.createInvoice(dataInvoice);
easyinvoice.download(`pizza_mario_invoice_${res.data._id}.pdf`, result.pdf);

      if (res.status === 201) {
       dispatch(reset());
        router.push(`/orders/${res.data._id}`);
      }
    } catch (err) {
      console.log(err);
    }
  };
   const handleClickRemoveProduct = (product) => {
    dispatch(removeProduct({...product}));
  };

  // Custom component to wrap the PayPalButtons and handle currency changes
  const ButtonWrapper = ({ currency, showSpinner }) => {
    // usePayPalScriptReducer can be use only inside children of PayPalScriptProviders
    // This is the main reason to wrap the PayPalButtons in a new component
    const [{ options, isPending }, dispatch] = usePayPalScriptReducer();

    useEffect(() => {
      dispatch({
        type: "resetOptions",
        value: {
          ...options,
          currency: currency,
        },
      });
    // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [currency, showSpinner]);

    const regex = new RegExp

    

    return (
      <>
        {showSpinner && isPending && <div className="spinner" />}
        <PayPalButtons
          style={style}
          disabled={false}
          forceReRender={[amount, currency, style]}
          fundingSource={undefined}
          createOrder={(data, actions) => {
            return actions.order
              .create({
                purchase_units: [
                  {
                    amount: {
                      currency_code: currency,
                      value: amount,
                    },
                  },
                ],
              })
              .then((orderId) => {
                // Your code here after create the order
                return orderId;
              });
          }}
          onApprove={function (data, actions) {
            return actions.order.capture().then(function (details) {
              const shipping = details.purchase_units[0].shipping;
              createOrder({
                customer: shipping.name.full_name,
                address: shipping.address.address_line_1,
                total: cart.total,
                method: 1,
              });
            });
          }}
        />
      </>
    );
  };



  return (
    <div className={styles.container}>
        <div className={styles.left}>
            <table className={styles.table}>
                <thead>
                <tr className={styles.trTitle}>
                    <th>Product</th>
                    <th>Name</th>
                    <th>Extras</th>
                    <th>Price</th>
                    <th>Quantity</th>
                    <th>Total</th>
                    <th>Cancel</th>
                </tr>
                </thead>
                <tbody>
                {cart.products.map(product => (
                    <tr className={styles.tr} key={product._id}>
                    <td>
                        <div className={styles.imgContainer}>
                            <Image src={product.img} layout='fill' objectFit='cover' alt={product.name} />
                        </div>
                    </td>
                    <td>
                        <span className={styles.name}>{product.title}</span>
                    </td>
                    <td>
                        <span className={styles.extras}>{product.extras.map((extra, index) => (
                      <span key={extra._id}>{extra.text}{index < product.extras.length - 1 ? ", " : ""}
                      </span>
                    ))}</span>
                    </td>
                    <td>
                        <span className={styles.price}>${product.price}</span>
                    </td>
                    <td>
                        <span className={styles.quantity}>{product.quantity}</span>
                    </td>
                    <td>
                        <span className={styles.total}>${product.price * product.quantity}</span>
                    </td>
                    <td>
                        <button className={styles.remove} onClick={() => handleClickRemoveProduct(product)} >
                            <Image src="/img/remove.png" 
                            height={40}
                            width={40}
                            alt="remove_order_icon" />
                        </button>
                    </td>
                </tr>
                ))}               
                </tbody>
            </table>
        </div>
         <div className={styles.right}>
            <div className={styles.wrapper}>
                <h2 className={styles.title}>CART TOTAL</h2>
                <div className={styles.totalText}>
                    <b className={styles.totalTextTitle}>Subtotal:</b>${cart.total}
                </div>
                <div className={styles.totalText}>
                    <b className={styles.totalTextTitle}>Discount:</b>$0.00
                </div>
                <div className={styles.totalText}>
                    <b className={styles.totalTextTitle}>Total:</b>${cart.total}
                </div>
               {open && cart.products.length !== 0 ? (
            <div className={styles.paymentMethods}>
              <button
                className={styles.payButton}
                onClick={() => setCash(true)}
              >
                Cash On Delivery
              </button>
              <PayPalScriptProvider
                options={{
                  "client-id":
                  process.env.PAYPAL_CLIENT_ID || "sb",
                  components: "buttons",
                  currency: "USD",
                  "disable-funding": "credit,card,p24",
                }}
              >
                <ButtonWrapper currency={currency} showSpinner={false} />
              </PayPalScriptProvider>
            </div>
          ) : (
            <button onClick={() => setOpen(true)} className={ cart.products.length !== 0 ? `${styles.button}` : `${styles.buttonDisabled}`}>
              Checkout Now!
            </button>
          )}
            </div>
         </div>
         {cash && <OrderDetail total={cart.total} createOrder={createOrder} />}
    </div>
  )
}

export default Cart;